import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Consultation.css';

const Consultation = () => {
  const [doctors, setDoctors] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [searchFilter, setSearchFilter] = useState('availability');
  const hospitalId = localStorage.getItem('hospitalId'); // Retrieve hospital ID from storage

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/doctors/${hospitalId}`);
        setDoctors(response.data.doctors || []); // Update state with doctors data
      } catch (error) {
        console.error('There was an error fetching the doctors!', error);
      }
    };

    if (hospitalId) {
      fetchDoctors();
    }
  }, [hospitalId]);

  const handleSearchQueryChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSearchFilterChange = (e) => {
    setSearchFilter(e.target.value);
  };

  const handleSearchSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/consultation', {
        search_query: searchQuery,
        search_filter: searchFilter
      });

      if (response.status === 200) {
        alert('Search successful!');
        // Handle successful search (e.g., update state, etc.)
      } else {
        alert('Search failed. Please try again.');
      }
    } catch (error) {
      console.error('There was an error during the search!', error);
      alert('Search failed due to a server error.');
    }
  };

  return (
    <div>
      <div className="header">
        <img src="consultation.jpg" alt="Hospital Directory" />
      </div>

      <div className="content">
        <h1>Stay connected to your health journey with our Video Consultation Services.</h1>
        <form onSubmit={handleSearchSubmit} className="search-container">
          <input 
            type="text" 
            name="search_query" 
            className="search-bar" 
            placeholder="Search..." 
            value={searchQuery}
            onChange={handleSearchQueryChange}
          />
          <select 
            name="search_filter" 
            className="search-dropdown"
            value={searchFilter}
            onChange={handleSearchFilterChange}
          >
            <option value="availability">Availability</option>
            <option value="doctor-name">Doctor Name</option>
            <option value="specialization">Specialization</option>
            <option value="closest-doctor">Closest Doctor</option>
            <option value="hospital-name">Hospital Name</option>
          </select>
          <button 
            type="submit" 
            className="search-button"
          >
            Search
          </button>
        </form>
        <video 
          autoPlay 
          loop 
          muted
        >
          <source src="consultation.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>

      <div className="content">
        <h2>Health Care, from the comfort of your home</h2>
        <p>Don't Delay Care For you and those you love. Consult doctors online.</p>
        <a href="#" className="book-now">Book an Appointment</a>
      </div>

      <div className="doctor-table">
        <h2>Doctors in Your Hospital</h2>
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Specialization</th>
              <th>Email</th>
              <th>Doctor ID</th>
            </tr>
          </thead>
          <tbody>
            {doctors.map((doctor, index) => (
              <tr key={index}>
                <td>{doctor.name}</td>
                <td>{doctor.specialization}</td>
                <td>{doctor.email}</td>
                <td>{doctor.Doctor_ID}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <footer>
        <marquee direction="left">
          Greetings from Find my Doctor - India's only Centralized Availability Source of Your Medical Needs &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
          Greetings from Find my Doctor - India's only Centralized Availability Source of Your Medical Needs &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
          Greetings from Find my Doctor - India's only Centralized Availability Source of Your Medical Needs
        </marquee>
      </footer>
    </div>
  );
};

export default Consultation;
